export default class DataProvider {
    getData(name) {
        return fetch(`./${name}.json`)
            .then(response => {
                if (!response.ok) {
                    throw new Error(`Response error: ${response.status}`);
                }
                console.log(response)
                return response;
            })
            .then(data => console.log(data));
    }
}
